import React from 'react';
import './nav.css';

class nav extends React.Component {

  constructor() {
    super()
    this.state={
      page: ''
    }
  }

  selectRegister = () => {
    this.setState({page: 'registerPage'});
  }

  selectSignIn = () => {
    this.setState({page: 'signInPage'});
  }

  render() {
    return (
      <div className="App navigation">
        <button type='button' id='registerBtn' className='glassmorph'>Register</button>
        <button type='button' id='signInBtn' className='glassmorph'>Sign-In</button>
      </div>
    );
  }
}

export default nav;
